create table battle_record
(
    id         int unsigned auto_increment comment 'id'
        primary key,
    win        varchar(128) null comment 'win',
    lost       varchar(128) null comment 'lost',
    position   varchar(30)  null comment '内容',
    remark     varchar(200) null comment '状态',
    publish_at timestamp    null comment '发布时间',
    created_at timestamp    null,
    updated_at timestamp    null,
    deleted_at timestamp    null,
    create_by  int unsigned null,
    update_by  int unsigned null
)
    comment '战斗记录';

create index idx_battle_deleted_at
    on battle_record (deleted_at);

